import {
    Switch,
    Route,
    Link
} from "react-router-dom";
import { Homepage } from "../../pages";

import './Navbar.css';

export function Navbar() {
    return (
        <div className="page-container">
            <nav className="navbar">
                <div className="link-container">
                    <Link to="/">Home</Link>
                </div>
                <div className="link-container">
                    <a href="#">Random link 1</a>
                </div>
                <div className="link-container">
                    <a href="#">Random link 1</a>
                </div>
            </nav>

            <Switch>
                <Route path="/">
                    <Homepage />
                </Route>
            </Switch>
        </div>
    )
}
